/* eslint-disable react/prop-types */
import React from "react";
import Drawer from "@material-ui/core/Drawer";
import withStyles from "@material-ui/core/styles/withStyles";
import { useAuth } from "context/AuthContext";
import {
  List,
  ListItem,
  ListItemIcon,
  ListItemText,
  Divider,
} from "@material-ui/core";
import InboxIcon from "@material-ui/icons/MoveToInbox";
import MailIcon from "@material-ui/icons/Mail";

const styles = () => ({
  list: {
    width: 250,
  },
  fullList: {
    width: "auto",
  },
});
const navList = {
  registeredUser: [
    "Home",
    "Health Topics",
    "Artiles",
    "Profiles",
    "Documents",
    "Dashboard",
  ],
  admin: ["Home", "Health Topics", "Artiles", "Documents", "Dashboard"],
  unRegisteredUser: ["Home", "Health Topics", "Artiles"],
};

const DrawerComponent = ({ classes, toggleDrawerHandler, left }) => {
  const { currentUser } = useAuth();
  // const [left] = useState(false);

  const sideList = (side) => (
    <div
      className={classes.list}
      role="presentation"
      onClick={toggleDrawerHandler}
      onKeyDown={toggleDrawerHandler}
    >
      <List>
        {["Inbox", "Starred", "Send email", "Drafts"].map((text, index) => (
          <ListItem button key={text}>
            <ListItemIcon>
              {index % 2 === 0 ? <InboxIcon /> : <MailIcon />}
            </ListItemIcon>
            <ListItemText primary={text} />
          </ListItem>
        ))}
      </List>
      <Divider />
      <List>
        {["All mail", "Trash", "Spam"].map((text, index) => (
          <ListItem button key={text}>
            <ListItemIcon>
              {index % 2 === 0 ? <InboxIcon /> : <MailIcon />}
            </ListItemIcon>
            <ListItemText primary={text} />
          </ListItem>
        ))}
      </List>
    </div>
  );

  return (
    <Drawer open={left} onClose={toggleDrawerHandler}>
      {sideList("left")}
    </Drawer>
  );
};

export default withStyles(styles)(DrawerComponent);
